import axios from 'axios';

const DeleteWilder	= ({id, refresh}) => { 
	const remove = (e) => {
		e.preventDefault();
		axios.delete(`http://localhost:5000/api/wilder/delete/${id}`)
		.then(res => {
			console.log(res);
			console.log(res.data);
			refresh();
		})
	}

	return (
		<button onClick={(e) => remove(e)}>Delete</button>
	)
}

export default DeleteWilder;
